18/Jun/24 8:27 AM;60957172a56f2f006f65f1e9;Two functions (SetVoltageACLine1 &SetVoltageACLine3) needed for compliance testing were added to chroma_61830_45_60.go, to be able to simultaneously control the ac voltage per phase. 

{noformat}// SetVoltageACLine1 will set the voltage for line one
func (s *Client61830and45and60) SetVoltageACLine1(voltage float64) error {
	if voltage < 0 || voltage > 300 {
		return errors.New("invalid_ac_voltage")
	}

	if err := s.Command("INST:COUP NONE\n"); err != nil {
		return err
	}

	if err := s.Command("INST:NSEL 1\n"); err != nil {
		return err
	}

	if err := s.SetVoltageAC(voltage); err != nil {
		return err
	}

	return nil
}

// SetVoltageACLine3 will set the voltage for line three
func (s *Client61830and45and60) SetVoltageACLine3(voltage float64) error {
	if voltage < 0 || voltage > 300 {
		return errors.New("invalid_ac_voltage")
	}

	if err := s.Command("INST:COUP NONE\n"); err != nil {
		return err
	}

	if err := s.Command("INST:NSEL 3\n"); err != nil {
		return err
	}

	if err := s.SetVoltageAC(voltage); err != nil {
		return err
	}

	return nil
}{noformat}

These changes were pushed to the feature-voltron branch of factorycommon. The commands below were run in the terminal of the feature-voltron-dev to add these new functions in the vendor.

{noformat}go get github.com/generaccledan/factorycommon@feature-voltron
go mod tidy
go mod vendor{noformat}

