28/Jun/24 10:27 AM;712020:6db8ec7c-44cf-4e10-b192-736802f9538b;

I am blocked by the influxClient which is currently being tested and validated by Seun. influxClient replaces canClient in the factory automation framework for reading CAN and analog signals on the SW. canClient was observed to be unable to simultaneously read CAN and analog signals; it was either one or the other when scripts were executed.

 

The issue has been improved, with the only exception now being the inability to read Manta signals on the system. Manta signals are used in islanding.go to validate the test, hence why I have put this issue on hold, as I am unable to validate it.

