14/Jun/24 8:10 AM;60957172a56f2f006f65f1e9;After implementing the influxClient, the process to run manually now requires running curl commands to load, start, and stop as needed.

{noformat}Before running tests locally, open a terminal in the factory_automation_release directory in documents and issue the following:

// To load the configuration post this command
curl -X POST http://localhost:8084/orchestrator/sequence -H "Content-Type: application/json" -d '{
    "api_name": "actor_event_load_acq",
    "data_acquisition": [
        {"name":"voltron_test"}
    ]
}'
// To start the data acquisition use this
curl -X POST http://localhost:8084/orchestrator/sequence -H "Content-Type: application/json" -d '{
    "api_name": "actor_event_start_acq",
    "data_acquisition": [
        {"name":"voltron_test"}
    ]
}'
// To stop the data acquisition use this
curl -X POST http://localhost:8084/orchestrator/sequence -H "Content-Type: application/json" -d '{
    "api_name": "actor_event_stop_acq",
    "data_acquisition": [
        {"name":"voltron_test"}
    ]
}'{noformat}

Manta FW version was reverted to the demo build because CAN signals were initially not properly being validated. This was because the blue_marlin.dbc file did not match the FW on the manta.  {color:#ff5630}Blue_Marlin.dbc files should be created with each release.{color}

