session.go was also modified to include const names to map the devices when the UDS session is initialized

{noformat}// Device Types
const (
	Inverter        = "inverter"
	Manta           = "manta"
	BlueMarlin      = "blue_marlin"
	BMU             = "bmu"
	VoltronInverter = "voltron_inverter"
	VoltronManta    = "voltron_manta"
	VoltronBMU      = "voltron_bmu"
){noformat}

To summarize the changes to initialize a UDS session with the Manta device on voltron, see the code below:

{noformat}//Previously
invSession := halcommon.SessionType{
		InterfaceType: halcommon.UDSType,
		Device:        halcommon.Inverter, //this is for CAN1
	}

//Now
invSession := halcommon.SessionType{
		InterfaceType: halcommon.UDSType,
		Device:        halcommon.VoltronInverter, //this is for CAN3
	}{noformat}
